import "../styles/editor.scss";
import "../styles/App.css";
import "@fontsource/press-start-2p";

export default function Editor() {
    return (
    <div id="editor">
        <h1>Pixel Art App</h1>
        <h2>Enter Dimensions</h2>
        <div id="options"></div>
        <div className="option">
            <input 
                type="number" 
                className="panelInput" 
                defaultValue="16" 
                // onChange={}
            ></input>
            <span> Width</span>
        </div>
        <div className="option">
            <input 
                type="number" 
                className="panelInput" 
                defaultValue="16" 
                // onChange={}
            ></input>
            <span>Height</span>
        </div>
        
        <button className="button">dwa</button>
    </div>
    );

}
